import React, { Component } from "react";

class Recap extends Component {
    render() {
        return (
            <div>
                <h1 className="display-4 theme-font" id="#recap">Fall 2018 Recap</h1>
                <hr />
                <div class="container">
                    <div class="col-sm-12">
                        <img class="img-fluid" src="./assets/stats_fall2018.png" alt="stats image" style='width=100%'></img>
                    </div>
                </div>
             </div>
        )
    }
}

export default Recap;
